      <div>
        <h2>{response.definitions.word}</h2>
        {
          (response.definitions.phonetics,
          map(function (phonetic, index) {
            return <Phonetics />;
          }))
        }
        {response.definitions.meanings.map(function (meaning, index) {
          return (
            <div key={index}>
